import { StyleSheet, View, Text } from "react-native";

const RegistrationScreen = () => {
  return (
    <View style={styles.container}>
      <Text style={styles.title}>Реєстрація</Text>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    marginTop: 500,
  },
  title: {
    color: "#212121",
    fontSize: 30,
    // font: Roboto,
    // Weight: 500,
    // Size: 30,
    // LineHeight: 35.16,
    // Letter: 1 %,
    // Align: Center,
  },
});

export default RegistrationScreen;
